import React from "react";
import "./About.css";

const About = () => {
  // 기능 구현 로직
  return (
    <div id="about">
      <div class="About">
        <div class="inner">
          <h1>ABOUT</h1>
        </div>
      </div>
      <div id="profile">
        <div class="inner">
          <div class="left">
            <div class="left-inner">
              <div class="card-wraper">
                <div class="card">
                  <div class="bio"></div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default About;
